import React from 'react';
import styled from 'styled-components';
import { BrowserRouter, Switch, Route } from 'react-router-dom'

const Main = () => {
    return (
        <MainStyled>
          <BrowserRouter>
            <Switch>
                <Route />
            </Switch>
          </BrowserRouter>
        </MainStyled>
    );
}

export default Main;

const MainStyled = styled.main`
    h1 {
        font-size: 75px;
    }
`;
